description:
Bree Olson Charlie's Favorite Goddess!
Duh, Winning! I Was The First! That's How I Roll!
Bree Olson - Fed Up With Everyone Getting Attention But Her, Bree Decides To Take Matters Into Her Own Hands!
Capri Anderson - Having Never Kissed A Boy, Capri Helps Her Best Friend Learn How To Kiss And Shows Her They Don't Need Boys!
Kacey Jordan - A Young Masseuse, Kacey Isn't Familiar With The Terminology Of The Trade But Is Curious To Find Out What A 'Happy Ending' Is!
Melanie Rios - Needing Help With Her Studies, Melanie Finds Herself To Be The Hands On Subject In Her Tutoring Session!
While House Sitting, Kacey Gets An Unexpected Surprise And Is Terrified She May Lose Her Job!
Ginger Shows Elexis Monroe Why She's Considered One Of The Most Intense Performers To Ever Grace The Screen!

Bree Olson, Capri Anderson, Kacey Jordan, Melanie Rios, Ginger Lynn.

